<?php

declare(strict_types=1);

namespace ApeDevDe\MicrosoftGraphSdk\Models;

/**
 * PrintCertificateSigningRequest
 */
class PrintCertificateSigningRequest
{
    /**
     * A base64-encoded pkcs10 certificate request. Read-only.
     */
    private ?string $content;

    /**
     * The base64-encoded public portion of an asymmetric key that is generated by the client. Read-only.
     */
    private ?string $transportKey;


    public function getContent(): ?string
    {
        return $this->content;
    }

    public function setContent(?string $content): self
    {
        $this->content = $content;
        return $this;
    }

    public function getTransportKey(): ?string
    {
        return $this->transportKey;
    }

    public function setTransportKey(?string $transportKey): self
    {
        $this->transportKey = $transportKey;
        return $this;
    }

}
